The Vector.<T> type is an optimized insertion-order collection of values that is used similiarly to Array. For numbers where T is one of the numeric types, the Vector class is represented more efficiently compared to Array. The following program demonstrates general usage of Vector: const vector:Vector.<Number> = new <Number> [ 10, 5 ]; // populate that Vector with more elements
for (var i:int = 1, j:int = 0; i <= 10; i++, j = ++j % 2)
{ vector.push(vector[j] * i);
} trace("enumerating values..."); for each (var val:Number in vector)
{ trace(val);
}

