The whack.utils.Dictionary type is a flexible mapping of arbitrary key-value pairs, where the user may access these pairs using common property operators. The Dictionary type is safe to use when it comes to solving name ambiguity: Reading, writing or deleting a property from a Dictionary object will always access key-value pair data of the Dictionary. Calling a property within a Dictionary object will call a method defined by the Dictionary class. The following program demonstrates the effects of using Dictionary: import whack.utils.Dictionary; const dict = new Dictionary();
dict.x = 10;
trace(dict.length()); // 1 dict.length = 0;
trace(dict.length()) // 2; for (var k in dict)
{ trace(k);
}
// "x"
// "length" for each (var v in dict)
{ trace(v);
}
// 10
// 0 delete dict.length; dict.m = function(a:Number):* (a * 10);
trace(dict.call("m", 10)); // 100

